function eventChatCommand(name,cmd,n)

    local c = { }
    string.gsub(cmd, "%S+", function(arg)
        c[#c + 1] = arg
    end)

if c[1] == "noportals" and conf.noportals == false then conf.noportals = true tfm.exec.chatMessage("<BV>Tagad turpmākajās mapēs vairs nebūs portālu.") print("<BV>Tagad turpmākajās mapēs vairs nebūs portālu.")
elseif c[1] == "noportals" and conf.noportals == true then conf.noportals = false tfm.exec.chatMessage("<BV>Tagad turpmākajās mapēs būs portāli.") print("<BV>Tagad turpmākajās mapēs būs portāli.") end
if c[1] == "flymode" and conf.flymode == false then conf.flymode = true tfm.exec.chatMessage("<BV>Tagad turpmākajās mapēs varēs lidot.") print("<BV>Tagad turpmākajās mapēs varēs lidot.")
elseif c[1] == "flymode" and conf.flymode == true then conf.flymode = false tfm.exec.chatMessage("<BV>Tagad turpmākajās mapēs vairs nevarēs lidot.") print("<BV>Tagad turpmākajās mapēs vairs nevarēs lidot.") end
if c[1] == "kill" then tfm.exec.killPlayer(c[2]) end
if c[1] == "map" then tfm.exec.newGame(eval[tonumber(c[2])]) end
if c[1] == "choose" then catcher = players[math.random(#players)] tfm.exec.chatMessage("<BV>Vadītājs ir: <CH>"..catcher) print("<BV>Vadītājs ir: <CH>"..catcher) end
if c[1] == "map*" then tfm.exec.newGame(eval[tonumber(c[2])],true) end
end

function gui(name)
ui.addTextArea(32, "<font size='10'><p align='center'>"..tostring(thismap).." <BL>|</BL> <J>nav portālu:<BL> "..tostring(conf.noportals).." <BL>|</BL> <J>spoguļmape:<BL> "..tostring(tfm.get.room.mirroredMap).." |</BL> <J>lidotspēja:<BL> "..tostring(conf.flymode), name, 150, 380, 500, 27, 0x000022, 0x000022, 0.8, true)
ui.addTextArea(64, "<ROSE><a href='event:minimizePanel'><font size='10'>X</a>", nil, 640, 380, 20, 27, 0x000022, 0x000022, 0, true)
end

function rmgui(name)
ui.removeTextArea(32,name) 
ui.addTextArea(64, "<ROSE><p align='center'><a href='event:restorePanel'>+</a>", name, 6, 22, 12, 15, 0x000022, 0x000022, 0.8, true)
end

function eventNewPlayer(name)
tfm.exec.bindKeyboard(name,1,true,true)
tfm.exec.bindKeyboard(name,120,true,true)
end

function eventKeyboard(n, key, down, x, y)
	if key==1 and conf.flymode == true then tfm.exec.movePlayer(n,0,0,true,0,-17,true) end
	if key==120 then for k,v in pairs(tfm.get.room.objectList) do table.insert(objects,k) end tfm.exec.removeObject(objects[math.random(#objects)]) print("<R>*_*") end	
end

function eventNewGame()
	for k,v in next, tfm.get.room.playerList do
    players[#players+1] = k
	end
    local Ptag = string.match(tfm.get.room.xmlMapInfo.xml, "<P (.-)/>")
    local meta = string.match(Ptag, 'meta ?= ?"(.-)"')
    local mapName

    if meta then
        	mapName = string.gsub(meta, ",", "<BL> - $", 1).."</BL>" end
			thismap = string.gsub("<J>"..tostring(meta), ",", "<BL> - $", 1) print(thismap)

	    ui.setMapName(mapName)
	if Ptag:find('portal') and conf.noportals == false then
		for value in Ptag:gmatch('portal="(.+)"') do
			print(value)            
			tfm.exec.addShamanObject(26,tonumber(value:match('(.-);'):match('(.-),')),tonumber(value:match('(.-);'):match(',(.+)')),0,0,0,false)
			tfm.exec.addShamanObject(27,tonumber(value:match(';(.+)'):match('(.-),')),tonumber(value:match(';(.+)'):match(',(.+)')),0,0,0,false)    
		end
	end
	gui()
end

function eventTextAreaCallback(textAreaID, name, callback)
if callback=="minimizePanel" then rmgui(name) end
if callback=="restorePanel" then gui(name) end
end

function eventPopupAnswer(popupID, playerName, answer)
if popupID==0 then print("<N><b>[b]<VP>[color=#30ba76]Pieņemts[/color]</VP>[/b]</b>[color=#92cf91]<T> - būs pieejams "..answer.." versijā.</T>[/color]") end  
if popupID==1 then print("<N><b>[b]<font color='#eb1d51'>[color=#eb1d51]Nav pieņemts[/color]</font>[/b]</b><R> - "..answer) end
if popupID==2 then print("<N><b>[b]<font color='#eb1d51'>[color=#eb1d51]Pieņemu ar labojumiem[/color]</font>[/b]</b><R> - "..answer) end
if popupID==3 then print("<N><b>[b]<CE>[color=#e68d43]Pieņemts[/color]</CE>[/b]</b>[color=#f0a78e]<CEP> - būs pieejama kā rezerves mape! <font size='10'>[size=10]"..answer.."[/size]</font></CEP>[/color]") end
if popupID==4 then print("<N><b>[b]<CE>[color=#e68d43]Pieņemts[/color]</CE>[/b]</b>[color=#f0a78e]<CEP> - atstāju rezerves rotācijā, līdz izlaboju dizainu. <font size='10'>[size=10]"..answer.."[/size]</font></CEP>[/color]") end
end

for name,player in pairs(tfm.get.room.playerList) do eventNewPlayer(name) end
